import clsx from 'clsx'
import style from './home.module.scss'


export default function UserSlider() {
  return (
    <div className={clsx(style.userSlider, 'grid','wide')}>
      <div className={clsx(style.userList,'row')}>
        {Array.from({ length: 2 }).map((item, index) => (
          <div className={clsx(style.userItem,'col', 'l-6')}>
            <img className={clsx.style.imgSlider} src={process.env.PUBLIC_URL + `/userSlider/img${index + 1}.jpg`} />
          </div>
        ))}
      </div>
      <div className={clsx(style.userList,'row')}>
        {Array.from({ length: 3 }).map((item, index) => (
          <div className={clsx(style.userItem,'col', 'l-4')}>
            <img className={clsx.style.imgSlider} src={process.env.PUBLIC_URL + `/userSlider/img${index + 3}.jpg`} />
          </div>
        ))}
      </div>
    </div>
  )
}
